import React from "react";
import Navbar from "./Components/Navbar";
import { Outlet } from "react-router-dom";

function RoutesLayout() {
  return (
    <div>
      <Navbar />
      <div className="container">
        <Outlet />
      </div>
    </div>
  );
}

export default RoutesLayout;
